import React from 'react'
import { useAuth } from '../context/authContext'

export default function HomePage() {
  const {isAuthenticated} = useAuth()
  return (
    <div className='container' style={{marginTop: "15px"}}>
    <div className="row">
      <h3>HomePage</h3>
    </div>
    </div>
  )
}
